ntre el punto A y B.\",\"alt\":\"Ilustración sobre la distancia entre dos puntos.\"},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Imagen\",\"license\":\"U\",\"title\":\"Sin título Imagen\",\"authors\":[],\"changes\":[]},\"subContentId\":\"688dace6-d2d3-442c-86d5-2a905e7ca260\"}],\"header\":\"Distancia\"},{\"position\":{\"x\":53.6,\"y\":62.024485016544716},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>El desplazamiento se entiende como el movimiento realizado por un cuerpo que se desplaza, que se traslada, de un lugar a otro. Las personas y la mayoría de los objetos son susceptibles de desplazarse, que es el único modo de cambiar de posición relativa en el espacio. Si se observa que un cuerpo está en un lugar distinto en dos momentos, significa que el cuerpo se ha desplazado.</p>\\n\\n<p>No hay que confundir la distancia con el desplazamiento. La primera es una magnitud escalar, para cuya medición bastan las unidades de longitud, mientras que el desplazamiento es una magnitud vectorial. Esta diferencia significa que su medición, a diferencia de la distancia, involucra también una dirección, es decir, un sentido.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sin título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"88f7452b-3648-462b-803d-710b71768301\"}],\"header\":\"Desplazamiento\"},{\"position\":{\"x\":40.8,\"y\":34.744270517779746},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>La trayectoria es el recorrido que describe un cuerpo al desplazarse respecto de un sistema de referencia. O dicho de otra forma, es la sucesión puntos que recorre un cuerpo que al unirlos obtenemos la trayectoria que ha descrito.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sin título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"15cbd24f-53d5-45fd-b450-3e47371a09b5\"},{\"params\":{\" s\":{\"text\":\"<p>El punto final es la posición o lugar donde un objeto termina su movimiento o donde se detiene después de desplazarse desde el punto inicial  dentro de un sistema de referencia determinado.</p>\\n\\n<p>Es el lugar que marca el final del recorrido y, junto con el punto inicial, permite determinar el <strong>desplazamiento</strong> del objeto, que es la distancia en línea recta entre ambos puntos, además de su dirección.</p>\\n\\n<p>El punto final es fundamental para entender cómo ha cambiado la posición del objeto durante el movimiento y para calcular magnitudes importantes como el desplazamiento y el tiempo total del viaje.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sin título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"11f84ce6-684d-48c5-ab7e-d672c6e49747\"}],\"header\":\"Posición Final\"}],\"hotspotNumberLabel\":\"Punto caliente (Hotspot) #num\",\"closeButtonLabel\":\"Cerrar\",\"containsAudioVideoLabel\":\"Contains Audio/Video\",\"image\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAABgAAAAQACAIAAACoEwUVAADai2NhQlgAANqLanVtYgAAAB5qdW1kYzJwYQARABCAAACqADibcQNjMnBhAAAANxNqdW1iAAAAR2p1bWRjMm1hABEAEIAAAKoAOJtxA3VybjpjMnBhOjg0N2ZjNGZiLWEwYzEtNDNmMy04NDE0LTI3ZmJlMTUxOTVhMQAAAAHhanVtYgAAAClqdW1kYzJhcwARABCAAACqADibcQNjMnBhLmFzc2VydGlvbnMAAAABBWp1bWIAAAApanVtZGNib3IAEQAQgAAAqgA4m3EDYzJwYS5hY3Rpb25zLnYyAAAAANRjYm9yoWdhY3Rpb25zgqNmYWN0aW9ubGMycGEuY3JlYXRlZG1zb2Z0d2FyZUFnZW50v2RuYW1lZkdQVC00b/9xZGlnaXRhbFNvdXJjZVR5cGV4Rmh0dHA6Ly9jdi5pcHRjLm9yZy9uZXdzY29kZXMvZGlnaXRhbHNvdXJjZXR5cGUvdHJhaW5lZEFsZ29yaXRobWljTWVkaWGiZmFjdGlvbm5jMnBhLmNvbnZlcnRlZG1zb2Z0d2FyZUFnZW50v2RuYW1lak9wZW5BSSBBUEn/AAAAq2p1bWIAAAAoanVtZGNib3IAEQAQgAAAqgA4m3EDYzJwYS5oYXNoLmRhdGEAAAAAe2Nib3KlamV4Y2x1c2lvbnOBomVzdGFydBghZmxlbmd0aBk3RWRuYW1lbmp1bWJmIG1hbmlmZXN0Y2FsZ2ZzaGEyNTZkaGFzaFggfGIZTxDV3NtzpBUt6JhgD8vWHjkvLeK4KeLHIdWloDdjcGFkSAAAAAAAAAAAAAAB5mp1bWIAAAAnanVtZGMyY2wAEQAQgAAAqgA4m3EDYzJwYS5jbGFpbS52
